import React from 'react'

import './css/AllCards.scss'

const AllCards = () => {
    return (
        <div className="card_container">
            <div className="list_container">
                Menu
            </div>

            <div className="card_box">
                CRAD
            </div>

        </div>
    )
}

export default AllCards;
